import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

const DoctorList = () => {
  const { state } = useLocation();
  const navigate = useNavigate();
  const { hospital } = state || {};

  const doctors = [
    { name: 'Dr. Ana Cruz', type: 'Dentist', history: '5 years experience' },
    { name: 'Dr. Jose Dela Paz', type: 'Cardiologist', history: '10 years experience' },
    { name: 'Dr. Maria Santos', type: 'Pediatrician', history: '8 years experience' },
  ];

  return (
    <div className="p-6">
      <h2 className="text-2xl mb-4">Doctors at {hospital}</h2>
      {doctors.map((doc, idx) => (
        <button
          key={idx}
          className="block w-full bg-green-100 p-4 mb-3 rounded"
          onClick={() => navigate('/doctor-profile', { state: { doctor: doc } })}
        >
          {doc.name} - {doc.type}
        </button>
      ))}
    </div>
  );
};

export default DoctorList;
